INSERT INTO `about_us` (`about_us_id`, `about_us_title`, `about_us_content`, `about_us_status`, `about_us_create_time`, `about_us_update_time`) VALUES
(1, '关于我们', '<p><span style="font-weight: 700; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);">深圳市红鸟网络科技有限公司</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);">（简称红鸟）成立于2012年，是</span><span style="font-weight: 700; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);">天瑞地安集团</span><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);">旗下一家全资子公司。公司集研发、销售为一体的网络娱乐软件开发商</span></p><p>红鸟现阶段拥有正式员工300余人，红鸟秉承&quot;和谐，积极，乐观，进取&quot;的核心经营理念。<br/></p><p>红鸟网络科技在不断优化自身的产品，同时将推出更多适应市场的互联网娱乐软件。 红鸟网络科技将依凭丰富的资源优势、成熟的游戏经验，率领众多合作伙伴，倾心致力于互联网娱乐软件产品的研发和服务，通过公司的发展努力追求“帮助更多的企业加入到IT行业” ！网络技术开发(不含互联网上网服务);计算机软硬件开发、销售,技术咨询; 电子产品 通讯设备</p><p><span style="background-color: rgb(255, 255, 255); font-family: &quot;Microsoft YaHei&quot;, SimHei, Verdana; font-size: 22px;"><br/></span></p><p><span style="background-color: rgb(255, 255, 255); font-family: &quot;Microsoft YaHei&quot;, SimHei, Verdana; font-size: 22px;">企业文化</span></p><p><span style="font-weight: 700;">企业愿景&nbsp;</span>： &nbsp; &nbsp; 成为世界最大的互联网企业。&nbsp;<br/><span style="font-weight: 700;">企业使命&nbsp;</span>： &nbsp; &nbsp; 帮助中国中小创业者在互联网游戏行业成功创业。<br/><span style="font-weight: 700;">企业宗旨&nbsp;</span>： &nbsp; &nbsp; 做中国最能打造创业家的互联网企业。&nbsp;<br/><span style="font-weight: 700;">红鸟的精神&nbsp;</span>： &nbsp;积极向上，乐观进取。<br/><span style="font-weight: 700;">红鸟的作风： &nbsp;&nbsp;</span>信守承诺，注重细节，绝对服从，永不言败&nbsp;<br/><span style="font-weight: 700;">红鸟的价值观</span>：和谐 积极 乐观 进取</p><p><span style="font-weight: 700;">&nbsp; &nbsp;</span></p><p><span style="font-weight: 700;">核心理念&nbsp;</span><span style="font-weight: 700;"><br/></span><span style="font-weight: 700;">创业理念&nbsp;</span>：意气奋发不在一时，持续奋斗才是英雄&nbsp;<br/><span style="font-weight: 700;">发展理念&nbsp;</span>：牺牲小我，完成大我&nbsp;<br/><span style="font-weight: 700;">经营理念&nbsp;</span>：汇天下资源，集八方豪杰，创千秋伟业&nbsp;<br/><span style="font-weight: 700;">营销理念</span>： 一切营销都是为了结果&nbsp;<br/><span style="font-weight: 700;">服务理念</span>： 以客户为中心，用心做服务<br/><span style="font-weight: 700;">品牌理念</span>： 品牌创造价值，价值创造财富&nbsp;<br/><span style="font-weight: 700;">工作理念&nbsp;</span>：专注就是力量，简单的方法练到极致就是绝招&nbsp;<br/><span style="font-weight: 700;">做人理念&nbsp;</span>：倾财足以聚人，量宽足以得人；身先足以率人，率己足以服人&nbsp;<br/><span style="font-weight: 700;">用人理念&nbsp;</span>：立场第一，能力第二&nbsp;<br/><span style="font-weight: 700;">薪酬理念：&nbsp;</span>有成果就有报酬，无成果就是耻辱<br/><span style="font-weight: 700;">晋升理念&nbsp;</span>：创造成果，培养人才，得以晋升&nbsp;<br/><span style="font-weight: 700;">执行理念&nbsp;</span>：制度第一，领导第二<br/><span style="font-weight: 700;">组织理念：&nbsp;</span>想组织所需，做组织所要&nbsp;<br/><span style="font-weight: 700;">成果理念</span>： 只有更好，没有满足</p><p><span style="color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);"><br/></span><br/></p>', 'Y', 0, 1511142237),
(2, '联系我们', '<p style="text-align: left;"><span style=";font-family:微软雅黑;font-size:14px">地图位置&nbsp;</span></p><p style="text-align:center"><img width="530" height="340" src="http://api.map.baidu.com/staticimage?center=113.960083,22.547733&zoom=18&width=530&height=340&markers=113.960083,22.547733"/></p><p><span style="text-indent: 14px; font-family: 微软雅黑; font-size: 14px;"><br/></span></p><p><span style="text-indent: 14px; font-family: 微软雅黑; font-size: 14px;">地址：深圳市南山区大冲国际中心</span><span style="text-indent: 14px; font-family: 微软雅黑; font-size: 14px;">5号楼5楼501</span></p><p><span style="font-family: 微软雅黑; font-size: 14px; text-indent: 14px;">商业合作：hotniao@mail.com</span></p><p><span style="font-family: 微软雅黑; font-size: 14px; text-indent: 14px;">市场合作：<span style="font-family: 微软雅黑; font-size: 14px; text-indent: 14px;">hotniao@mail.com</span></span></p><p><span style="font-family: 微软雅黑; font-size: 14px; text-indent: 14px;">投诉建议：<span style="font-family: 微软雅黑; font-size: 14px; text-indent: 14px;">hotniao@mail.com&nbsp;</span></span></p><p><img src="http://static.greenlive.1booker.com/upload/image/20171129/1511926585478954.png" title="1511926585478954.png" alt="happy_cowboy@2x.png"/><img src="http://static.greenlive.1booker.com/upload/image/20171129/1511926684555106.png" title="1511926684555106.png" alt="happy_cowboy@2x.png"/><img src="http://static.greenlive.1booker.com/upload/image/20171129/1511927372576613.png" title="1511927372576613.png" alt="happy_cowboy@2x.png"/><img src="http://static.greenlive.1booker.com/upload/image/20171129/1511934720773265.png" title="1511934720773265.png" alt="80x80.png"/></p>', 'Y', 0, 1511934735);
INSERT INTO `agreement` (`agreement_id`, `agreement_type`, `agreement_name`, `agreement_content`, `agreement_create_time`, `agreement_update_time`) VALUES
(1, 1, '注册协议', '<p style="margin-top:0;margin-right:0;margin-bottom:50px;margin-left:0;padding:0 0 0 0 ;line-height:24px"><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">尊敬的用户您好，在同意本协议前，请您认真阅读并充分知悉、理解</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台的各项规则及要求，以及国家关于该类互联网信息服务的法律法规等。如果您对本协议的任何条款表示异议，您可以选择不使用；</span></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">使用则意味着您将同意遵守本协议下全部规定，以及我们后续对使用协议随时所作的任何修改，并完全服从于我们的统一管理。</span></span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">本协议已对与您的权益有或可能具有重大关系的条款，及对</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台具有或可能具有免责或限制责任的条款用粗体字予以标注，请您注意。</span></span></p><h4 style="margin-top:10px;margin-right:0;margin-bottom:60px;margin-left:0;padding:0 0 0 0 "><strong><span style="font-family: 宋体;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 14px"><span style="font-family:宋体">第一章</span> <span style="font-family:宋体">总则</span></span></strong></h4><p style="margin-top:0;margin-right:0;margin-bottom:50px;margin-left:0;padding:0 0 0 0 ;line-height:24px"><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>1条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台是</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">团队</span>(以下统称“本团队”)向用户提供的一种更方便的进行视频直播、观看视频直播服务并与注册用户进行互动的视频社交平台。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台将为用户提供虚拟礼物、技术支持、流量入口等进行视频社交所需的服务。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>2条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台所有权、经营权、管理权均属本团队。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>3条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;</span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">本协议最终解释权归属本团队。</span></span></strong></p><h4 style="margin-top:10px;margin-right:0;margin-bottom:60px;margin-left:0;padding:0 0 0 0 "><strong><span style="font-family: 宋体;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 14px"><span style="font-family:宋体">第二章</span> </span></strong><strong><span style="font-family: 宋体;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 14px"><span style="font-family:宋体">火鸟</span></span></strong><strong><span style="font-family: 宋体;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 14px"><span style="font-family:宋体">平台账号</span></span></strong></h4><p style="margin-top:0;margin-right:0;margin-bottom:50px;margin-left:0;padding:0 0 0 0 ;line-height:24px"><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>4条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您注册成功后，</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台将为您提供一个账号（下称</span>“</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">账号</span>”）。您在申请使用</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台服务时，应当向</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台提供真实、准确的个人资料，以完成实名认证；如个人资料有任何变动，您须及时在</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台上予以更新。您在使用</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台产品、服务或者浏览网页之时即同意</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台收集、保有并与合作伙伴分享您的相关个人信息。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>5条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">账号性质上是您接受</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台向其提供服务的凭证；同时是您持有、使用</span>“</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">