style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span></strong><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台发现使用者并非账号初始注册人，有权不经通知收回账号而无需向账号使用人承担法律责任，由此带来的包括并不限于通讯中断、资料和虚拟财产清空等损失由您自行承担。</span></span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>7条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您可自主设定账号名称、头像、简介等注册信息，不得含有违法和不良信息；如存在该等情况，</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台有权采取通知限期改正、暂停使用、注销登记等措施。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>8条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您同意</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台无偿使用您的名称（包括但不限于真实姓名、笔名、网名及任何代表您身份的文字符号）、肖像（包括但不限于真人肖像及卡通肖像）以及其他相关个人信息进行</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台的各类宣传、向合作伙伴分享、与合作伙伴共同向用户展示用户可能感兴趣的内容等行动。</span></span></p><h4 style="margin-top:10px;margin-right:0;margin-bottom:60px;margin-left:0;padding:0 0 0 0 "><strong><span style="font-family: 宋体;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 14px"><span style="font-family:宋体">第三章</span> <span style="font-family:宋体">用户说明</span></span></strong></h4><p style="margin-top:0;margin-right:0;margin-bottom:50px;margin-left:0;padding:0 0 0 0 ;line-height:24px"><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>9条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;凡是下载、浏览和发布内容的用户均为</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台用户。您可在</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台进行视频直播（此时您称为</span>“主播”）、观看视频直播服务并与其他注册用户互动，赠与或接受其他注册用户或</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台赠与的虚拟礼物，赠与的虚拟礼物一经送出即不可撤销。但您与</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台不构成任何法律制度层面的雇佣、劳动或劳务关系。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>10条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您必须年满18周岁。 本协议内容不受您所属国家或地区法律的排斥。不具备前述条件的，您应立即终止注册或停止使用。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>11条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您自己承担进行视频直播和观看视频直播所需要的网络、设备，并保证直播图像和语音质量的清晰、稳定。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>12条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您的个人信息受到保护，不接受任何个人或单位的查询，但是国家机关依法查询除外，您的个人设置公开除外。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>13条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;在不违反适用法律法规的前提下，您享有言论自由的权利。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>14条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您的言行不得违反《计算机信息网络国际联网安全保护管理办法》、《互联网信息服务管理办法》、《互联网电子公告服务管理规定》、《维护互联网安全的决定》、《互联网新闻信息服务管理规定》等相关法律规定，不得在</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台上发布、传播或以其它方式传送含有下列内容之一的直播内容或信息：</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">1.反对宪法所确定的基本原则的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">2.危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">3.损害国家荣誉和利益的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">4.煽动民族仇恨、民族歧视、破坏民族团结的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">5.破坏国家宗教政策，宣扬邪教和封建迷信的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">6.散布谣言，扰乱社会秩序，破坏社会稳定的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">7.散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">8.侮辱或者诽谤他人，侵害他人合法权利的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">9.未获他人允许，偷拍、偷录他人，侵害他人合法权利的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">10.煽动非法集会、结社、游行、示威、聚众扰乱社会秩序的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">11.以非法民间组织名义活动的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">12.含有虚假、有害、胁迫、侵害他人隐私、骚扰、侵害、侮辱、诽谤、中伤、粗俗、猥亵、或其它道德上令人反感的内容；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">13.侵犯他人知识产权的内容；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">14.含有中国法律、法规、规章、条例以及任何具有法律效力之规范所限制或禁止的其它内容的。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>15条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您不得在</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台内发布任何形式的广告。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>16条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您不得采用任何形式进行网络赌博活动，包括以“</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">金币</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">”、“</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">银币</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">”、“虚拟礼物”等虚拟财产为标的或赌资进行线上赌博，或者通过直播平台组织线下赌博活动。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">将严密监控此类行为，并有权对多个定向账户中异常的、数额较大的虚拟资产流转进行调查，，并有权配合主管机关的调查提交您的身份资料、有关账户的交易记录等信息。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>17条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您不得利用本平台进行任何形式的洗钱活动。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">将严密监控此类行为，并有权对多个定向账户中异常的、数额较大的虚拟资产流转进行调查，并有权配合主管机关的调查提交您的身份资料、有关账户的交易记录等信息。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>18条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您通过苹果应用商店充值的次数每天不能超过20次，如果超过20次则</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台冻结该账户。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">如果您违规使用非本人苹果手机应用商店代冲值，或者通过其它非</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台认可的渠道非法购买</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">银币</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">，则</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台有权冻结该账户，并进行相应惩罚，严重者可以进行封号处理。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>19条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您应承担一切因您个人的行为而直接或间接导致的民事、行政或刑事法律责任，因您违反法律法规或违反本协议的行为给本团队造成损失的，您应负责赔偿。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>20条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;禁止任何使用非法软件进行刷内容、违规发布内容的行为。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>21条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您发现</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台上有内容涉嫌违法违规、侮辱或者诽谤他人、侵害他人合法权益、违反本协议或</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台任何运营和管理规则的，有权进行直接举报。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>22条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;未经</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台书面同意，您不得在</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台上以任何方式提及第三方竞争平台的相关信息，不得引导用户进入其他第三方竞争平台或为其提供任何信息或便利。</span></span></p><h4 style="margin-top:10px;margin-right:0;margin-bottom:60px;margin-left:0;padding:0 0 0 0 "><strong><span style="font-family: 宋体;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 14px"><span style="font-family:宋体">第四章</span> <span style="font-family:宋体">权利声明</span></span></strong></h4><p style="margin-top:0;margin-right:0;margin-bottom:50px;margin-left:0;padding:0 0 0 0 ;line-height:24px"><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>23条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;本团队有权制定平台运营规则及注册用户管理规则，并有权根据运营情况对相应规则进行变更、调整、中止或终止。本团队拥有对</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台上的内容进行监控并对违反协议的用户进行处理的权利。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>24条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;您在</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台发布、直播内容仅为个人行为，与本团队无关。对于您的直播内容、言论的真实性、合法性引发的全部责任，由您自行承担，本团队不承担任何责任。因您发布的直播内容、言论而引起的法律纠纷，由您自行解决，与本团队无关。如</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台因此遭受任何损失，</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台有权向您追偿，您应向</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台承担相应的损害赔偿责任，您承担赔偿责任的方式包括但不限于根据</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台的书面通知向其支付与损失等额的资金、以累计的虚拟资产（如</span>“</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">银币</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">”、“</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">金币</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">”）抵偿相关损失等。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>25条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;用户之间因使用</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台而产生或可能产生的任何纠纷和</span>/或损失，由用户自行解决并承担相应的责任，与本团队无关。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>26条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台未来可能提供部分收费的网络服务，对于此类服务，</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台会在您使用前给与您明确的提示，只有您根据提示确认愿意支付相关费用，您才能使用该等收费网路服务；如果您拒绝支付相关费用，则</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台有权不向您提供该等收费网络服务。</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>27条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台系统因下列状况无法正常运作，使您无法使用各项服务或任何信息、虚拟财产丢失时，本团队不承担损害赔偿责任，该状况包括但不限于：（</span>1）在</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台公告之系统停机维护、升级、调整期间；（</span>2）电信通讯或设备出现故障不能进行数据传输的；（3）因台风、地震、海啸、洪水、停电、战争、恐怖袭击、政府管制等不可抗力之因素，造成</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">火鸟</span></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">平台系统障碍不能执行业务的；（</span>4）由于黑客攻击、电信部门技术调整或故障、网站升级、相关第三方的问题等原因而造成的服务中断或者延迟。</span></p><h4 style="margin-top:10px;margin-right:0;margin-bottom:60px;margin-left:0;padding:0 0 0 0 "><strong><span style="font-family: 宋体;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 14px"><span style="font-family:宋体">第五章</span> <span style="font-family:宋体">处罚规则</span></span></strong></h4><p style="margin-top:0;margin-right:0;margin-bottom:50px;margin-left:0;padding:0 0 0 0 ;line-height:24px"><strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><span style="font-family:微软雅黑">第</span>28条</span></strong><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">&nbsp;凡您发布、直播的内容或信息出现以下情况之一，本团队管理人员有权不提前通知您直接采取停播、删除内容。情节严重者，本团队管理人员有权采取关闭部分或全部权限、暂时封禁账号或永久封禁账号、配合主管部门调查等措施。</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">1.发布、传播含有本协议第14条禁止发布、传播的内容；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">2.发表无意义的灌水内容；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">3.同一内容多次出现的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">4.违反本协议第15条的规定，发布广告的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">5.违反本协议第16条的规定，从事任何形式赌博行为的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">6.违反本协议第17条的规定，从事任何洗钱行为的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">7.内容包含有严重影响您浏览的内容或格式的；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">8.从事非法商业活动；</span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px"><br/></span><span style="font-family: 微软雅黑;color: rgb(49, 49, 49);letter-spacing: 0;font-size: 12px">9.假冒管理人员或破坏管理人员形象；</span><span styl