INSERT INTO `question` (`question_id`, `question_category_id`, `question_title`, `question_content`, `question_sort`, `question_status`, `question_create_time`, `question_update_time`) VALUES
(1, 1, '百度帐号被封禁，如何解封？', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="background-color: rgb(252, 252, 252); color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif;">帐号封禁分为两种：</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">一、全站封禁：</span><br/><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">如您在尝试登录帐号时，提示您“因安全问题被限制登录”，则您的帐号因违反《百度用户协议》被全站封禁，无法解封；</span><br/><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">二、产品线封禁：</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">如您的帐号可正常登录，但被百度单产品线封禁，请您前往该产品线，了解封禁原因并进行线上申诉。</span><br/><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">三、产品线封禁解封办法</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">：</span><br/><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">1. 贴吧</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">：</span><br/><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">a. 贴吧无法登录</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">：&nbsp;</span><br/><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">建议在登录状态下到</span><a href="http://tieba.baidu.com/hermes/feedback" target="_blank" title="百度贴吧问题反馈" style="margin: 0px; padding: 0px; background-color: transparent; color: rgb(0, 115, 235); text-decoration: none; outline: 0px;"><span style="margin: 0px; padding: 0px; font-weight: bolder;">百度贴吧问题反馈</span></a><span style="margin: 0px; padding: 0px; font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252); color: rgb(0, 112, 192);">，</span><span style="margin: 0px; padding: 0px; font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252); color: rgb(0, 112, 192);">&nbsp;<span style="margin: 0px; padding: 0px; color: rgb(0, 0, 0);">使用其他的贴吧帐号， 反馈自己的帐号问题，提交后耐心等待处理结果&nbsp;</span></span><br/><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">b.贴吧可正常登录</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">，</span><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">无法发贴或回帖</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">， 请您按照以下提示操作：&nbsp;</span><br/><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">（1）请进入贴吧官网https://tieba.baidu.com —登录贴吧 —更多—服务中心—系统处理记录，查看到当前的处理状态；</span><br/><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">（2）如提 示通过验证修改密码可解封，请您自行操作解封；&nbsp;</span><br/><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">（3） 如帐号仍未解封，请您前往</span><a href="http://tieba.baidu.com/hermes/feedback" target="_blank" style="margin: 0px; padding: 0px; background-color: transparent; color: rgb(0, 115, 235); text-decoration: none; outline: 0px;"><span style="margin: 0px; padding: 0px; font-weight: bolder;">贴吧反馈中心</span></a><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">，详细描述您的问题，提交问题反馈，会有专门的工作人员帮助您。&nbsp;</span><br/><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">2. 网盘</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">：您的帐号有被盗嫌疑、涉嫌公用违规帐号、或被用户举报而被封禁，请您至此处了解封禁原因和以及线上申诉：</span><a href="http://pan.baidu.com/disk/appeal" target="_blank" style="margin: 0px; padding: 0px; background-color: transparent; color: rgb(0, 115, 235); text-decoration: none; outline: 0px;">http://pan.baidu.com/disk/appeal</a><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">。申诉后还请您耐心等待解封，严重违规的将永久封禁不予解封</span><br/><span style="margin: 0px; padding: 0px; font-weight: 700; box-sizing: border-box; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">3. 其他产品线</span><span style="margin: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;helvetica neue&quot;, helvetica, &quot;hiragino sans gb&quot;, arial, &quot;Microsoft YaHei&quot;, 微软雅黑, SimSun, 宋体, sans-serif; background-color: rgb(252, 252, 252);">：请按照页面提示进行操作，或联系产品线在线客服进行咨询。</span></p><p><br/></p>', 2, 'Y', 0, 1511148185),
(2, 1, '百度帐号申诉未通过，忘记信息', '<p><span style="color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; background-color: rgb(255, 255, 255);">1. 申请未通过的原因是由于您填写的申诉信息错误信息太多。建议您再次回想正确信息，重新提交申诉，如单纯的某一两项填写错误，不会完全影响到您的申诉结果。如您实在无法想起，建议您随机填写，但是随机填写可能会影响您的申诉结果。还请您再次确认该信息后提交申诉，我们会再次帮您进行审核。</span></p><p><span style="color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; background-color: rgb(255, 255, 255);"><br/></span></p><p><span style="color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; background-color: rgb(255, 255, 255);">2.申诉提交后会有12小时保护时间，保护期间绑定手机可回复短信终止申诉，同时，被短信终止后48小时后才能再次提交申诉。</span></p><p><span style="color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; background-color: rgb(255, 255, 255);"><br/></span></p><p><span style="color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; background-color: rgb(255, 255, 255);">3.如您需要查询申诉时哪些信息填写错误，您可拨打百度帐号客服热线：010-80287828（客服时间：周一至周五9:00-21:00）进行咨询，将您帐号信息及申诉时的联系手机，提供给客服进行查询，根据客服提示回想帐号信息后，再次提交申诉&nbsp;&nbsp;</span><br/><span style="color: rgb(102, 102, 102); font-family: PingFangSC-Regular, sans-serif, &quot;Microsoft YaHei&quot;, 微软雅黑, simHei, Arial; font-size: 14px; background-color: rgb(255, 255, 255);">&nbsp;</span></p>', 1, 'Y', 1510906476, 1511258545);
